function load(s)
    for t in all(split(s, ";")) do
        local parts = split(t, ",")
        if parts then
            add_map_tile(parts[1], parts[2], parts[4], parts[3], parts[5] == 1, parts[6] == 1, parts[7])
        end
    end
end

